import React, { Component } from 'react';
import { Wrapper, AgroTable, Th } from "./table.style";
import faker from 'faker';
import axios from "axios";
//import { Input } from "../input/input.style"

class RestaurantUpationbyID extends Component {
  initialState = {
    //searchTerm: '',
    restaurantList:[]
  };

  state = this.initialState;
   componentDidMount() {
    axios.get("http://localhost:8080/restaurant/5c9d06dc2077e45c3322198f").then(response => {
      this.setState({restaurantList : response.data.responseData})
    })

  } 

  render() {
    return (
      <input
          value={this.state.restaurantList.address}
          //onChange={evt => this.setState({ address: evt.target.value })}
          type="text"
          placeholder="Address"
        />
    );
  }
}

export default RestaurantUpationbyID;
